column2:
[TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["'Adversaries may attempt to position themselves between two or more networked devices using an adversary-in-the-middle (AiTM) technique to support follow-on behaviors such as Network Sniffing, Transmitted Data Manipulation, or replay attacks (Exploitation for Credential Access)'"],
    "Explanation": "The Snort rule detects an attempt to perform a Responder poisoner SMB attack, which is a type of adversary-in-the-middle attack. The attacker positions themselves between the client and server to intercept and manipulate SMB traffic, potentially leading to credential theft or other malicious activities."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to intercept and/or manipulate network traffic."],
    "Explanation": "The Snort rule detects an attempt to perform an SMB attack known as 'Responder poisoner', which is a type of Adversary-in-the-Middle attack. The rule looks for specific content in the network traffic that indicates an attempt to intercept and manipulate SMB communication between hosts."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1078",
    "Technique name": "Valid Accounts",
    "Quotes": ["\"Adversaries may obtain and abuse credentials of existing accounts as a means of gaining Initial Access, Persistence, Privilege Escalation, or Defense Evasion\""],
    "Explanation": "The Snort rule detects an attempt to perform an SMB attack known as 'Responder poisoner', which involves capturing and abusing valid credentials from the network traffic. This aligns with the Valid Accounts technique, where adversaries abuse legitimate credentials to gain unauthorized access or escalate privileges."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1185",
    "Technique name": "Browser Session Hijacking",
    "Quotes": ["\"Adversaries may take advantage of security vulnerabilities and inherent functionality in browser software to change content, modify user-behaviors, and intercept information as part of various browser session hijacking techniques\""],
    "Explanation": "The Snort rule detects an attempt to perform a Responder poisoner SMB attack, which is a type of session hijacking attack that exploits the Server Message Block (SMB) protocol used for file sharing and network browsing. The attack aims to intercept and hijack SMB sessions, allowing the attacker to potentially gain unauthorized access to network resources."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1555",
    "Technique name": "Credentials from Password Stores",
    "Quotes": ["\"Adversaries may search for common password storage locations to obtain user credentials\""],
    "Explanation": "The Snort rule detects an attempt by the Responder tool to perform an SMB relay attack, which can be used to obtain credentials from password stores on the target system. The rule looks for specific content in the SMB traffic that indicates a Responder poisoner attack."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1499",
    "Technique name": "Endpoint Denial of Service",
    "Quotes": ["'Adversaries may perform Endpoint Denial of Service (DoS) attacks to degrade or block the availability of services to users'"],
    "Explanation": "The Snort rule is designed to detect a SMB attack attempt known as 'Responder poisoner', which is a type of Denial of Service (DoS) attack that aims to disrupt the availability of network services by poisoning the SMB protocol. This aligns with the 'Endpoint Denial of Service' technique, where adversaries perform DoS attacks to degrade or block the availability of services to users."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1210",
    "Technique name": "Exploitation of Remote Services",
    "Quotes": ["Adversaries may exploit remote services to gain unauthorized access to internal systems once inside of a network"],
    "Explanation": "The Snort rule detects an attempt to exploit the Server Message Block (SMB) protocol on port 445, which is a remote service used for file sharing and network browsing. The rule specifically looks for a pattern that indicates a 'Responder poisoner SMB attack attempt', which is a technique used by adversaries to exploit vulnerabilities in the SMB protocol and gain unauthorized access to internal systems."
  }
]', type='text')][TextBlock(text='[
    {
        "sid": "50106",
        "Technique ID": "T1036",
        "Technique name": "Masquerading",
        "Quotes": ["Adversaries may attempt to manipulate features of their artifacts to make them appear legitimate or benign to users and/or security tools"],
        "Explanation": "The Snort rule detects an attempt by the Responder tool to perform an SMB attack by masquerading as a legitimate SMB service. The content field matches the string 'WINPRH492RQAFV.SMB3.local', which is likely a crafted SMB service name used by Responder to trick systems into connecting to it."
    }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1135",
    "Technique name": "Network Share Discovery",
    "Quotes": ["'Adversaries may look for folders and drives shared on remote systems as a means of identifying sources of information to gather as a precursor for Collection and to identify potential systems of interest for Lateral Movement'"],
    "Explanation": "The Snort rule detects an attempt to perform an SMB attack, which is commonly used for network share discovery and lateral movement within a network. The rule specifically looks for the string 'WINPRH492RQAFV.SMB3.local', which is indicative of a Responder poisoner SMB attack attempt."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1566",
    "Technique name": "Phishing",
    "Quotes": ["'Adversaries may send phishing messages to gain access to victim systems'"],
    "Explanation": "The Snort rule detects an attempt to perform an SMB attack using the Responder tool, which is often used in phishing campaigns to capture credentials and gain unauthorized access to systems."
  },
  {
    "sid": "50106",
    "Technique ID": "T1003",
    "Technique name": "OS Credential Dumping",
    "Quotes": ["'Adversaries may attempt to dump credentials to obtain account login and credential material, normally in the form of a hash or a clear text password, from the operating system and software'"],
    "Explanation": "The Responder tool used in the detected attack is designed to capture credentials, which aligns with the OS Credential Dumping technique used by adversaries to obtain login credentials from the operating system."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1021",
    "Technique name": "Remote Services",
    "Quotes": ["'Adversaries may use Valid Accounts to log into a service that accepts remote connections, such as telnet, SSH, and VNC'"],
    "Explanation": "The Snort rule detects an attempt to exploit the Server Message Block (SMB) protocol on port 445, which is used for remote file sharing and remote service access. This aligns with the 'Remote Services' technique, where adversaries leverage remote services to gain unauthorized access to systems."
  }
]', type='text')]

[TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1071",
    "Technique name": "Application Layer Protocol",
    "Quotes": ["Adversaries may communicate using OSI application layer protocols to avoid detection/network filtering by blending in with existing traffic"],
    "Explanation": "The Snort rule is monitoring HTTP traffic to detect access to the '/login.htm' URI, which is a common web application login page. This aligns with the 'Application Layer Protocol' technique, where adversaries may use application layer protocols like HTTP to blend in with legitimate traffic and avoid detection."
  }
]', type='text')][TextBlock(text='[
    {
        "sid": "1564",
        "Technique ID": "T1539",
        "Technique name": "Steal Web Session Cookie",
        "Quotes": ["An adversary may steal web application or service session cookies and use them to gain access to web applications or Internet services as an authenticated user without needing credentials"],
        "Explanation": "The Snort rule is detecting access to the '/login.htm' URI on a web server, which could be an attempt by an adversary to steal web session cookies from an authenticated user to gain unauthorized access to the web application or service."
    }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1078",
    "Technique name": "Valid Accounts",
    "Quotes": ["\"Adversaries may obtain and abuse credentials of existing accounts as a means of gaining Initial Access, Persistence, Privilege Escalation, or Defense Evasion\""],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI, which is typically used for authenticating with valid user accounts. This could indicate an attempt by an adversary to gain initial access or elevate privileges by abusing valid account credentials."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1185",
    "Technique name": "Browser Session Hijacking",
    "Quotes": ["'Adversaries may take advantage of security vulnerabilities and inherent functionality in browser software to change content, modify user-behaviors, and intercept information as part of various browser session hijacking techniques'"],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI, which could be an attempt to hijack a user's browser session by exploiting vulnerabilities or inherent functionality in web applications or browser software. This aligns with the Browser Session Hijacking technique, where adversaries may try to intercept or manipulate user sessions for malicious purposes."
  }
]', type='text')][TextBlock(text='[
    {
        "sid": "1564",
        "Technique ID": "T1213",
        "Technique name": "Data from Information Repositories",
        "Quotes": ["'Adversaries may leverage information repositories to mine valuable information'"],
        "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI, which is likely a login page for a web application. By accessing this page, an adversary may be attempting to gather information from the web application's information repository (e.g., user credentials, sensitive data) for malicious purposes."
    }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1190",
    "Technique name": "Exploit Public-Facing Application",
    "Quotes": ["Adversaries may attempt to take advantage of a weakness in an Internet-facing computer or program using software, data, or commands in order to cause unintended or unanticipated behavior."],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI on HTTP servers, which could potentially indicate an attempt to exploit a vulnerability in a public-facing web application or login page. This aligns with the 'Exploit Public-Facing Application' technique, where adversaries target vulnerabilities in Internet-accessible applications or services."
  }
]', type='text')][TextBlock(text='[
    {
        "sid": "1564",
        "Technique ID": "T1190",
        "Technique name": "Exploit Public-Facing Application",
        "Quotes": ["Adversaries may attempt to exploit a weakness in an Internet-facing host or system to initially access a network"],
        "Explanation": "The Snort rule is detecting access to the '/login.htm' page on a web server, which could be an attempt to exploit a vulnerability in the public-facing web application to gain initial access to the network."
    },
    {
        "sid": "1564",
        "Technique ID": "T1212",
        "Technique name": "Exploitation for Credential Access",
        "Quotes": ["Adversaries may exploit software vulnerabilities in an attempt to collect credentials"],
        "Explanation": "The '/login.htm' page is typically used for authentication, so this activity could be an attempt to exploit a vulnerability in the login page to steal credentials."
    }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1036",
    "Technique name": "Masquerading",
    "Quotes": ["Adversaries may attempt to manipulate features of their artifacts to make them appear legitimate or benign to users and/or security tools"],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI on web servers, which could potentially be an attempt by an adversary to masquerade as a legitimate user or service to gain unauthorized access to the system."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1046",
    "Technique name": "Network Service Discovery",
    "Quotes": ["Adversaries may attempt to get a listing of services running on remote hosts and local network infrastructure devices, including those that may be vulnerable to remote software exploitation"],
    "Explanation": "The Snort rule is detecting access to the '/login.htm' URI on HTTP servers, which could be an attempt by an adversary to discover and potentially exploit a web application login page, a form of network service discovery."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1219",
    "Technique name": "Remote Access Software",
    "Quotes": ["An adversary may use legitimate desktop support and remote access software to establish an interactive command and control channel to target systems within networks"],
    "Explanation": "The Snort rule is detecting access to the 'login.htm' page, which could be an indication of an adversary attempting to gain remote access to a system or web application using legitimate remote access software or tools."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1021",
    "Technique name": "Remote Services",
    "Quotes": ["'Adversaries may use Valid Accounts to log into a service that accepts remote connections, such as telnet, SSH, and VNC'"],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI on HTTP servers, which suggests an attempt to access a remote service or web application login page. This aligns with the 'Remote Services' technique, where adversaries may use valid accounts to log into remote services."
  }
]', type='text')]

[TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1098",
    "Technique name": "Account Manipulation",
    "Quotes": ["'Adversaries may manipulate accounts to maintain and/or elevate access to victim systems'"],
    "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (admin/adminadmin), which is a form of Account Manipulation technique used by adversaries to gain unauthorized access to systems."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1078",
    "Technique name": "Valid Accounts",
    "Quotes": ["Adversaries may attempt to gain access to accounts using valid credentials."],
    "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (admin/adminadmin), which falls under the Valid Accounts technique where adversaries leverage legitimate credentials to gain initial access or elevate privileges."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1078",
    "Technique name": "Valid Accounts",
    "Quotes": ["'Adversaries may obtain and abuse credentials of existing accounts as a means of gaining Initial Access, Persistence, Privilege Escalation, or Defense Evasion'"],
    "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (j_username=admin and j_password=adminadmin), which aligns with the Valid Accounts technique where adversaries abuse existing credentials to gain unauthorized access."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1110",
    "Technique name": "Brute Force",
    "Quotes": ["'Adversaries may use brute force techniques to gain access to accounts when passwords are unknown or when password hashes are obtained'"],
    "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default credentials 'admin' and 'adminadmin', which suggests a brute force attack to gain unauthorized access to the server."
  },
  {
    "sid": "20158", 
    "Technique ID": "T1190",
    "Technique name": "Exploit Public-Facing Application",
    "Quotes": ["'Adversaries may attempt to take advantage of a weakness in an Internet-facing computer or program using software, data, or commands in order to cause unintended or unanticipated behavior.'"],
    "Explanation": "The rule is detecting an attempt to exploit the Oracle GlassFish Server, which is a public-facing web application, by using the default credentials to gain unauthorized access."
  }
]', type='text')][TextBlock(text='[
    {
        "sid": "20158",
        "Technique ID": "T1555",
        "Technique name": "Credentials from Password Stores",
        "Quotes": ["\"Adversaries may search for common password storage locations to obtain user credentials\""],
        "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (admin/adminadmin), which aligns with the technique of searching for and using stored credentials from password stores."
    }
]', type='text')][TextBlock(text='[
    {
        "sid": "20158",
        "Technique ID": "T1078",
        "Technique name": "Valid Accounts",
        "Quotes": ["\"SERVER-WEBAPP Oracle GlassFish Server default credentials login attempt\""],
        "Explanation": "The rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (j_username=admin and j_password=adminadmin), which is a common technique used by adversaries to gain initial access or elevate privileges on a compromised system by using valid accounts with default or well-known passwords."
    }
]', type='text')][TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1212",
    "Technique name": "Exploitation for Credential Access",
    "Quotes": ["Adversaries may exploit software vulnerabilities in an attempt to collect credentials"],
    "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (admin/adminadmin), which could be an indication of an adversary trying to exploit a vulnerability to gain unauthorized access and collect credentials."
  },
  {
    "sid": "20158", 
    "Technique ID": "T1190",
    "Technique name": "Exploit Public-Facing Application",
    "Quotes": ["Adversaries may attempt to exploit a weakness in an Internet-facing host or system to initially access a network"],
    "Explanation": "The rule is looking for traffic from an external network to an internal HTTP port, suggesting an attempt to exploit a public-facing web application (Oracle GlassFish Server) to gain initial access to the network."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1078",
    "Technique name": "Valid Accounts",
    "Quotes": ["Adversaries may attempt to log in to an existing account using valid credentials."],
    "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (admin/adminadmin), which falls under the Valid Accounts technique where adversaries leverage legitimate credentials to gain initial access or elevate privileges."
  },
  {
    "sid": "20158", 
    "Technique ID": "T1190",
    "Technique name": "Exploit Public-Facing Application",
    "Quotes": ["Adversaries may attempt to take advantage of a weakness in an Internet-facing computer or program using software, data, or commands in order to cause unintended or unanticipated behavior."],
    "Explanation": "The rule is detecting an attempt to exploit the Oracle GlassFish Server, which is a public-facing web application, by using the default administrative credentials. This aligns with the Exploit Public-Facing Application technique where adversaries target vulnerabilities in internet-accessible systems."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1556",
    "Technique name": "Modify Authentication Process",
    "Quotes": ["'Adversaries may modify authentication mechanisms and processes to access user credentials or enable otherwise unwarranted access to accounts'"],
    "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (admin/adminadmin), which is a form of modifying the authentication process to gain unauthorized access."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1003",
    "Technique name": "OS Credential Dumping",
    "Quotes": ["'Adversaries may attempt to dump credentials to obtain account login and credential material, normally in the form of a hash or a clear text password, from the operating system and software'"],
    "Explanation": "The Snort rule detects an attempt to log in to the Oracle GlassFish Server using the default administrative credentials (admin/adminadmin), which could be an indication of an adversary attempting to dump or obtain valid credentials for the system."
  },
  {
    "sid": "20158", 
    "Technique ID": "T1190",
    "Technique name": "Exploit Public-Facing Application",
    "Quotes": ["'Adversaries may attempt to take advantage of a weakness in an Internet-facing computer or program using software, data, or commands in order to cause unintended or unanticipated behavior.'"],
    "Explanation": "The rule is looking for attempts to exploit the default credentials in the Oracle GlassFish Server, which is a public-facing web application. Successful exploitation could allow an adversary to gain unauthorized access or control over the application."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "20158",
    "Technique ID": "T1078",
    "Technique name": "Valid Accounts",
    "Quotes": ["Adversaries may use Valid Accounts to log into a service that accepts remote connections, such as telnet, SSH, and VNC"],
