  }
]', type='text')]

[TextBlock(text='[
    {
        "sid": "10088",
        "Technique ID": "T1123",
        "Technique name": "Audio Capture",
        "Quotes": ["An adversary can leverage a computer's peripheral devices (e.g., webcams, microphones) to capture audio recordings which could obtain sensitive information."],
        "Explanation": "The Snort rule detects activity related to the 'Beyond Keylogger' malware, which is designed to capture keystrokes and other input data from the victim's system. This aligns with the 'Audio Capture' technique, where adversaries leverage peripheral devices like microphones to capture sensitive information."
    },
    {
        "sid": "10088",
        "Technique ID": "T1020",
        "Technique name": "Automated Exfiltration",
        "Quotes": ["Adversaries may exfiltrate data, such as sensitive documents, through the use of automated processing after being gathered during Collection"],
        "Explanation": "The rule detects the exfiltration of keylogger data via SMTP, which is an automated process for sending the collected data to the adversary. This aligns with the 'Automated Exfiltration' technique, where adversaries use automated methods to exfiltrate data after collecting it."
    }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["\"Adversaries may attempt to get information about the system from input data such as keystrokes for credential theft and other objectives.\""],
    "Explanation": "The Snort rule is designed to detect a keylogger named 'Beyond Keylogger' that sends logs via SMTP. Keyloggers are used to capture user input data like keystrokes, which aligns with the Input Capture technique (T1056) in MITRE ATT&CK."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["\"Adversaries may capture user input on compromised systems, such as by installing keystroke loggers, to obtain credentials and other sensitive information.\""],
    "Explanation": "The Snort rule detects activity related to the 'Beyond Keylogger' malware, which is designed to capture user input (keystrokes) on infected systems. This aligns with the Input Capture technique (T1056) in MITRE ATT&CK, where adversaries employ methods like keyloggers to capture sensitive information from user input."
  },
  {
    "sid": "10088", 
    "Technique ID": "T1102",
    "Technique name": "Web Service",
    "Quotes": ["\"Adversaries may use an existing, legitimate external Web service as a means for relaying data to/from a compromised system.\""],
    "Explanation": "The Snort rule detects the Beyond Keylogger malware sending captured data via SMTP (email), which could be considered a form of using a legitimate web service (email service) to relay data from the compromised system. This relates to the Web Service technique (T1102) in MITRE ATT&CK."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1115",
    "Technique name": "Clipboard Data",
    "Quotes": ["Adversaries may collect data stored in the clipboard from users copying information within or between applications"],
    "Explanation": "The Snort rule is designed to detect a keylogger malware called 'Beyond Keylogger' that is attempting to exfiltrate captured keystrokes or clipboard data via SMTP. The rule looks for specific patterns in the email subject line that indicate the presence of a log file from the keylogger. This aligns with the 'Clipboard Data' technique, where adversaries collect data from the clipboard to obtain sensitive information."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["\"Adversaries may employ keyloggers to capture user input data, such as credentials and other sensitive information.\""],
    "Explanation": "The Snort rule is designed to detect activity related to the 'Beyond Keylogger' malware, which is a keylogger used to capture user input data. The rule looks for specific patterns in the email subject line that indicate the keylogger is sending captured data via SMTP. This aligns with the 'Input Capture' technique, where adversaries use keyloggers to capture sensitive user input."
  },
  {
    "sid": "10088", 
    "Technique ID": "T1071",
    "Technique name": "Application Layer Protocol",
    "Quotes": ["\"Adversaries may use an application layer protocol for communication between host and C2 server or among hosts within a network.\""],
    "Explanation": "The Snort rule is specifically looking for the keylogger data being sent via SMTP (email), which is an application layer protocol. This suggests that the malware is using SMTP as a communication channel, likely to exfiltrate the captured data, which aligns with the 'Application Layer Protocol' technique."
  }
]', type='text')][TextBlock(text='[
    {
        "sid": "10088",
        "Technique ID": "T1114",
        "Technique name": "Email Collection",
        "Quotes": ["\"Adversaries may target user email to collect sensitive information\""],
        "Explanation": "The Snort rule is designed to detect a keylogger malware that exfiltrates captured data by sending it via email (SMTP protocol). This aligns with the 'Email Collection' technique, where adversaries collect sensitive information from user emails."
    },
    {
        "sid": "10088",
        "Technique ID": "T1056",
        "Technique name": "Input Capture",
        "Quotes": ["\"Input Capture techniques involve intercepting and capturing user input data, such as keystrokes, to obtain sensitive information.\""],
        "Explanation": "The rule specifically mentions 'Keylogger', which is a type of malware that captures user input, such as keystrokes, to steal sensitive information like passwords and credentials. This directly relates to the 'Input Capture' technique used by adversaries."
    }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
    "Technique name": "Input Capture",
    "Quotes": ["Adversaries may gather credential material by invoking or forcing a user to automatically provide authentication information through a mechanism in which they can intercept"],
    "Explanation": "The Snort rule detects activity related to a keylogger malware called 'Beyond Keylogger', which is designed to capture user input data such as keystrokes, potentially including credentials. This aligns with the 'Input Capture' technique from MITRE ATT&CK."
  },
  {
    "sid": "10088", 
    "Technique ID": "T1071",
    "Technique name": "Application Layer Protocol",
    "Quotes": ["Adversaries may use an application layer protocol for communication between host and C2 server or among hosts within a network."],
    "Explanation": "The rule is looking for SMTP traffic containing a specific subject line pattern, indicating that the keylogger malware is attempting to exfiltrate captured data over the SMTP protocol, which is an application layer protocol. This relates to the 'Application Layer Protocol' technique."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1056",
